INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "フリーマーケット会場", 0, 5118061, 7, "ペコリーヌとの出会い", 2, 40, 10118, 20063115, 91002, 2834, "青空の下で謁見", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "フリーマーケット会場", 0, 5118062, 7, "マホとの出会い", 2, 40, 10118, 20063115, 91002, 2835, "未来の騎空団\nマスコット？", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "ランドソル市街地", 0, 5118063, 7, "アキノとの出会い", 2, 40, 10118, 20063115, 91002, 2837, "お嬢さまからの\n緊急依頼", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "フリーマーケット会場", 0, 5118064, 18, "ジュンとの出会い", 2, 40, 10118, 20063115, 91002, 4108402, "黄金色の悩みごと", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "フリーマーケット会場", 0, 5118065, 18, "カオリとの出会い", 2, 40, 10118, 20063115, 91002, 4107402, "白熱！　格闘大会！", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "オーエド町", 1, 5118066, 16, "ニノンとの出会い", 2, 40, 10118, 20063115, 91002, 9000227, "祭り太鼓はオーエドの華", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "フリーマーケット会場", 0, 5118067, 19, "スズナとの出会い", 3, 40, 10118, 20063115, 91002, 2101181, "人気者は遅れて\nやってくる", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ランドソル市街地", 0, 5118068, 18, "ナナカとの出会い", 3, 40, 10118, 20063115, 91002, 4109402, "巫女・ミーツ・魔法少女", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "フリーマーケット会場", 0, 5118069, 18, "キャル＆コッコロとの出会い", 3, 40, 10118, 20063115, 91002, 4305402, "ネズ耳は二度なくなる", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ランドソル市街地", 0, 5118070, 18, "ユカリとの出会い", 3, 40, 10118, 20063115, 91002, 4101402, "この出会いにカンパイ！", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "ランドソル市街地", 0, 5118071, 18, "アオイとの出会い", 3, 40, 10118, 20063115, 91002, 4106402, "陰陽アンサンブル", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (8, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "フリーマーケット会場", 1, 5118072, 7, "シノブとの出会い", 3, 40, 10118, 20063115, 91002, 2836, "運試し十番勝負！", 1);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (0, 0, 0, 0, 5118600, 0, "オープニング", 1, 0, 10118, 20063115, 0, 0, "彼女たちの新たな日常", 0);
